def ascii_to_code(ascii_art):
  """Converts ASCII art into a code string.

  Args:
    ascii_art: The ASCII art string.

  Returns:
    The encoded ASCII art as a string.
  """

  # Escape special characters for string formatting
  escaped_art = ascii_art.replace('"', '\\"').replace("'", "\\'").replace("\n", "\\n").replace("\t", "\\t")

  # Create a formatted string
  code_string = f'"""{escaped_art}"""'

  return code_string

